        return (
            <header>
                <button>LeanOn.me</button>

                 <div className="actions">
                {this.props.currentUser ? (
            <>
                <Link to="/about_us">
                  <button>About Us</button>
                </Link>
                <Link to="/login">
                  <button>Login</button>
                </Link>


                <button onClick={this.handleLogout}>Logout {this.props.currentUser.username}</button>
            </>
          ) : (
              <>
                <Link to="/about_us">
                  <button>About Us</button>
                </Link>
                <Link to="/login">
                  <button>Login</button>
                </Link>
                <Link to="/profile">
                  <button>Profile Pic</button>
                </Link>

              </>
            )}
        </div>
      </header>
        )
    }
}

export default Header;
